text:
Más de 45 mil toneladas de escombros han sido retirados tras los #IncendiosForestales. Las máquinas y sus operadores han trabajado día y noche, llevando los escombros hasta los centros de acopio intermedios y, posteriormente, al vertedero #ElMolle.

Junto al seremi de @MOPValparaiso,
@YaninoRiquelme, la delegada de la @DPRValparaiso, @Sofia_gonzco y la alcaldesa de @MuniQuilpue, @ValeMelipillan, hoy realizamos una visita al centro de acopio en #CanalChacao, #Quilpué. Gracias a su funcionamiento, hemos logrado agilizar las labores de remoción, para dar paso, con mayor rapidez, a la etapa de reconstrucción.
